import React from "react";
import classes from "./Products.module.css";

const DUMMY_ITEMS = [
  {
    id: "m1",
    title: "Adidas",
    description: "Forward-looking silhouettes like the Ultraboost...",
    image: { product1 },
    price: 22.99,
  },
  {
    id: "m2",
    title: "Converse",
    description: "The enduring appeal of the Chuck Taylor...",
    image: { product2 },
    price: 16.5,
  },
  {
    id: "m3",
    title: "Reebok",
    description:
      "Founded in Britain, based in Boston, and bought by Germany's own Adidas...",
    image: { product3 },
    price: 12.99,
  },
  {
    id: "m5",
    title: "Vans",
    description: "Authentic in a way most sneakers can only pretend to be...",
    image: { product4 },
    price: 18.99,
  },
  {
    id: "m6",
    title: "Puma",
    description: "A formidable selection of retro-inflected lace-ups...",
    image: { product5 },
    price: 18.99,
  },
  {
    id: "m7",
    title: "Nike",
    description: "baddest name in the sneaker business...",
    image: { product6 },
    price: 18.99,
  },
];

const Products = () => {
  return (
    <>
      <div className={classes.topBar}>
        <p>Serena Williams Design Crew(17)</p>
        <div className={classes.filters}>
          <span>hide filters</span>
          <span>sort by</span>
        </div>
      </div>
      <section className={classes.mainProducts}>
        <div className={classes.sideBar}>sidebar</div>
        <div className={classes.products}></div>
      </section>
    </>
  );
};

export default Products;
